{"cells":[{"source":"<a href=\"https://www.kaggle.com/nawidahmadnoori/bike-share-analysis?scriptVersionId=87167401\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"17077102","metadata":{"papermill":{"duration":0.176168,"end_time":"2022-02-07T02:59:18.362686","exception":false,"start_time":"2022-02-07T02:59:18.186518","status":"completed"},"tags":[]},"source":["title: \"Cyclistic bike share analysis\"\n","author: \"Nawid Ahmad Noori\"\n","date: \"2/3/2022\""]},{"cell_type":"markdown","id":"4acf8bdd","metadata":{"papermill":{"duration":0.176845,"end_time":"2022-02-07T02:59:18.711096","exception":false,"start_time":"2022-02-07T02:59:18.534251","status":"completed"},"tags":[]},"source":["<h1>Cyclistic Bike Share Analysis</h1>"]},{"cell_type":"markdown","id":"beb35e57","metadata":{"papermill":{"duration":0.17365,"end_time":"2022-02-07T02:59:19.05915","exception":false,"start_time":"2022-02-07T02:59:18.8855","status":"completed"},"tags":[]},"source":["<h2>Introduction</h2>\n"," \n","This analysis case study is part of Google data analytics Professional certificate.I used bike-sharing company data to analyze user behavior, find similarities and differences, determine trends, and provide recommendations on how these insights can help the marketing team to create a campaign that would convert one type of users into another."]},{"cell_type":"markdown","id":"555e2605","metadata":{"papermill":{"duration":0.190603,"end_time":"2022-02-07T02:59:19.425904","exception":false,"start_time":"2022-02-07T02:59:19.235301","status":"completed"},"tags":[]},"source":["<h2>Scenario</h2>\n"," \n","Cyclistic is a bike-share company in Chicago,which have two types of customers,casual(pay for each ride) and members(pay yearly subscription), The director of marketing believes the company’s future success depends on maximizing the number of member customers. Therefore, we wants to understand how casual riders and member riders use Cyclistic bikes differently. From these insights, marketing team will design a new marketing strategy to convert casual riders into annual members."]},{"cell_type":"markdown","id":"e41ebd46","metadata":{"papermill":{"duration":0.280606,"end_time":"2022-02-07T02:59:19.891312","exception":false,"start_time":"2022-02-07T02:59:19.610706","status":"completed"},"tags":[]},"source":["<h2>Stakeholders</h2>\n"," \n","* Cyclistic: A bike-share program that features more than 5,800 bicycles and 600 docking stations.\n","* Lily Moreno: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","* Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy.\n","* Cyclistic Executive Team : Detail-oriented executive team that will decide whether to approve the recommended marketing program"]},{"cell_type":"markdown","id":"eef98e83","metadata":{"papermill":{"duration":0.188618,"end_time":"2022-02-07T02:59:20.275659","exception":false,"start_time":"2022-02-07T02:59:20.087041","status":"completed"},"tags":[]},"source":["<h2>Phase 1: ASK</h2>\n"," \n","<h3>Identify the business task</h3>\n"," \n","The key business task in this case study is to discover how casual riders and Cyclistic members use their rental bikes differently. Both the Director of Marketing as well as finance analysts have concluded that member customers are more profitable.\n"," \n","Therefore, the results of this analysis will be used to design a new marketing strategy to convert casual riders to annual members.\n"," \n","<h3>Consider key stakeholders</h3>\n"," \n","Key stakeholders include: Cyclistic executive team, Director of Marketing (Lily Moreno), Marketing Analytics team."]},{"cell_type":"markdown","id":"7a74f2c0","metadata":{"papermill":{"duration":0.190817,"end_time":"2022-02-07T02:59:20.652878","exception":false,"start_time":"2022-02-07T02:59:20.462061","status":"completed"},"tags":[]},"source":["<h2>Phase 2 : Prepare</h2>\n"," \n","\n","<h3>Data source</h3>\n","User data from the past 12 months, January 2021 - December 2021 are available in the company cloud storage. Each data set is consists of 13 columns with a various number of records depending on each month’s rides, data sets are in csv format and details every ride logged by Cyclistic customers. This data has been made publicly available via license by Motivate International Inc. and the city of Chicago available here. All user’s personal data has been scrubbed for privacy.\n"," \n","<h3>Determine the credibility of the data and bias</h3>\n","Due to the fact that this is a case study using public data, we are going to assume the data is credible.\n"," \n","<h3>Download data and store it appropriately</h3>\n","Data has been downloaded from the company cloud storage. Local copies have been stored securely on Data folder in the folder of the Rstudio project"]},{"cell_type":"markdown","id":"dd7a8a7e","metadata":{"papermill":{"duration":0.178915,"end_time":"2022-02-07T02:59:21.013409","exception":false,"start_time":"2022-02-07T02:59:20.834494","status":"completed"},"tags":[]},"source":["<h2>Phase 3 : Process</h2>\n","<h3>Choose your tools</h3>\n","For this analysis, we will be using R for it's easy statistical analysis tools and data visualizations.\n","<h3>Install and load necessary packages</h3>"]},{"cell_type":"code","execution_count":1,"id":"03bcdfbe","metadata":{"execution":{"iopub.execute_input":"2022-02-07T02:59:21.408105Z","iopub.status.busy":"2022-02-07T02:59:21.405871Z","iopub.status.idle":"2022-02-07T02:59:22.935691Z","shell.execute_reply":"2022-02-07T02:59:22.934549Z"},"papermill":{"duration":1.726353,"end_time":"2