BPILEDAAAA4In/BzSB3ObiwS0YAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["Data %>% filter(customer_type == \"casual\")%>%group_by(route) %>%summarise(total = n())%>% top_n(10) %>%arrange(total)%>%ggplot() + geom_col(mapping = aes(x=reorder(route,total),y=total),position = \"dodge\") + labs(x = \" Route\", y = \"Number of rides\",title = \"Number of  rides by top 10 routs with most number of rides\")+ coord_flip()"]},{"cell_type":"markdown","id":"866c2bcc","metadata":{"papermill":{"duration":0.274487,"end_time":"2022-02-07T03:04:05.189136","exception":false,"start_time":"2022-02-07T03:04:04.914649","status":"completed"},"tags":[]},"source":["the above visual shows, the top 10 routs with most number of rides by casual.\n"," \n","<h2>Phase 5 : Share</h2>\n"," \n","Now we’re ready to share our findings with team.\n"," \n","<h3>Key findings</h3>\n"," \n","●Casual riders mostly use bike-sharing for leisure and tourism purposes and are highly active on weekends\n"," \n","●Members use bike-sharing to commute to work during the week and are more active on weekdays rather than weekends.\n"," \n","●Casual riders ride nearly 50% longer than members on average\n"," \n","●Member riders mainly use the bikes for their commutes as their usage peaks on weekdays during rush hour\n"," \n","●Casual riders use the bikes more for leisure based on the peak usage in summer months and weekends\n"," \n","●Casual riders do not use the service during the winter months as much as annual members\n"," \n","●Annual members mainly use classic bikes and rarely use docked bikes but casual riders are more open to riding all kinds of bikes specially for ducked bike\n"," \n","  \n"," \n","<h2>Phase 6 : Act</h2>\n"," \n","<h3>Recommendations</h3>\n"," \n","1.Based on finding it’s worth considering to offer new types of membership focused on weekend rides\n"," \n","2.As Casual riders use bikes for much longer trips than members, we should offer bonuses for longer rides\n"," \n","3.The campaign should start in spring offering early-bird discounts for these new types of memberships and continue during the Summer peak\n"," \n","4.We should increase the number of ducked bikes in stations\n","  "]},{"cell_type":"markdown","id":"d654cb8c","metadata":{"papermill":{"duration":0.271553,"end_time":"2022-02-07T03:04:05.732069","exception":false,"start_time":"2022-02-07T03:04:05.460516","status":"completed"},"tags":[]},"source":["<h4>End of case study</h4>"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":291.72221,"end_time":"2022-02-07T03:04:06.329001","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-02-07T02:59:14.606791","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}